// Navbar.js
import React from 'react';

function Navbar({ design, setDesign}) {
  return (
  <nav>
    <ul>
      <li onClick={() => setDesign('casual')}></li>
      <li onClick={() => setDesign('professional')}></li>
      {/* Add other common navigation options */}
    </ul>
  </nav>
  );
}

export default Navbar;
